window.bookSummaryJSON = "<p>When Hal Emden hears about a contest that offers winners the chance to test the newest game from his favorite designer on a cutting-edge, unprecedented virtual reality system, he has to try his luck.&nbsp;</p> <p>Surprisingly, he wins. A full week, all expenses paid, to play the fully immersive game <i>Tides of Magic Online</i>.&nbsp;</p> <p>He is now about to play at what might be the largest live gaming press event of all time, which is swarming with journalists, online personalities, and other contest winners. What could possibly go wrong? I mean, it's not like Elwin, the creator of the game and series, is an insane psychopath intent on trapping them in his virtual world for purposes unknown...right?</p>"; 
